Insert into CONCEPT_DIMENSION (concept_path, concept_cd, name_char, concept_blob, update_date, download_date, import_date, sourcesystem_cd, upload_id) values ('\ACT\UMLS_C0031437\SNOMED_3947185011\UMLS_C0242656\UMLS_C1510665\UMLS_C1547137\A23576533\A23577340\A23573264\A21035410\','CPT4:99223', 'Initial hospital care, per day, for the evaluation and management of a patient, which requires these 3 key components: A comprehensive history; A comprehensive examination; and Medical decision making of high complexity. Counseling and/or coordination of care with other physicians, other qualified health care professionals, or agencies are provided consistent with the nature of the problem(s) and the patients and/or familys needs. Usually, the problem(s) requiring admission are of high severity. Typically, 70 minutes are spent at the bedside and on the patients hospital floor or unit.', null, CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP, 'ACT', 202004015);
